import { useState } from 'react'

const Header = (props) => {
  return <h1>props.text</h1>
}

function App() {
  return (
    <div>
      <Header text="Anecdote of the day"/>
      <Header text="Anecdote with most votes"/>
    </div>

  );
}

export default App;
